import React from 'react';
//import axios from 'axios';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

export default class AddUser extends React.Component{

//constructor() {
        //super();
	state = {
		nama : "",
		username : "",
		password : ""
	}
	//this.handleChange = this.handleChange.bind(this);
//}

handleChange(e){
	this.setState({ [e.target.name] : e.target.value });
	e.preventDefault()
}

render(){
	return(
		<Container className="mt-3" >
			<Row>
				<Col xs={12} lg={12} md={12} >
					<Form >
					  <Form.Group controlId="formBasicEmail">
					    <Form.Label>Nama</Form.Label>
					    <Form.Control name="nama" onChange={this.handleChange} type="text" placeholder="Nama" />
					  </Form.Group>
					  <Form.Group controlId="formBasicPassword">
					    <Form.Label>Username</Form.Label>
					    <Form.Control name="username" type="text" onChange={this.handleChange} placeholder="Username" />
					  </Form.Group>
					  <Form.Group controlId="formBasicPassword">
					    <Form.Label>Password</Form.Label>
					    <Form.Control name="password" type="text" onChange={this.handleChange} placeholder="Password" />
					  </Form.Group>
					  <Button variant="primary" type="submit">
					    Submit
					  </Button>
					</Form>
				</Col>
				<Col>
				Nama : {this.state.nama}
				</Col>
			</Row>
		</Container>
	)
}

}
